// ./ 의 위치: frontend/src/
// ../의 위치: frontend/
import React from 'react';
import './App.css';
import Home from './components/home';
import Company from './components/company';
import Board_MyList from './components/board_mylist';
import Board_Predict from './components/board_predict';
import Company_List from './components/company_list';
import Company_Like from './components/company_like';
import Company_Fav from './components/company_Fav';
import Login from './components/login';
import { Route, Routes } from 'react-router-dom'
import User_list from './components/user_list';
import Company_Basic_List from './components/company_basic_list'
import Write from './components/write';
import IdSearch from './components/idsearch';
import IdSearch_Result from './components/idsearch_result';
import PwSearch from './components/pwsearch';
import PwSearch_Result from './components/pwsearch_result';
import Join from './components/join';
import IdCheck from './components/idcheck';
import Info from './components/info';
import Info_Update from './components/info_update';
import Info_Delete from './components/info_delete';
const App: React.FC = () => {
  return (
    <Routes>
      <Route path='/' element={<Home/>}/> 
      <Route path='/company' element={<Company/>}/> 
      <Route path='/board_MyList' element={<Board_MyList/>}/> 
      <Route path='/board_Predict' element={<Board_Predict/>}/> 
      <Route path='/company_basic_list' element={<Company_Basic_List/>}/>
      <Route path='/company_list' element={<Company_List/>}/> 
      <Route path='/company_like' element={<Company_Like/>}/> 
      <Route path='/company_Fav' element={<Company_Fav/>}/> 
      <Route path='/' element={<Home/>}/>
      <Route path='/company' element={<Company/>}/>
      <Route path='/user_list' element={<User_list/>}/>
      <Route path='/write' element={<Write/>}/>
      <Route path='/login' element={<Login/>}/>
      <Route path='/idsearch' element={<IdSearch/>}/>
      <Route path='/idsearch_result' element={<IdSearch_Result/>}/>
      <Route path='/pwsearch' element={<PwSearch/>}/>
      <Route path='/pwsearch_result' element={<PwSearch_Result/>}/>
      <Route path='/join' element={<Join/>}/>
      <Route path='/idcheck' element={<IdCheck/>}/>
      <Route path='/info' element={<Info/>}/>
      <Route path='/info_update' element={<Info_Update/>}/>
      <Route path='/info_delete' element={<Info_Delete/>}/>
    </Routes>
  );
}


export default App;
